function mp_settings_accordion_start(){var t,e=document.getElementsByClassName("mp-settings-title-align");for(t=0;t<e.length;t++)e[t].addEventListener("click",(function(){this.classList.toggle("active");var t=null;console.log(this.childNodes);for(var e=0;e<this.childNodes.length;e++)if(this.childNodes[e]?.classList?.contains("mp-settings-margin-left")){t=this.childNodes[e];break}t.childNodes[1].classList.toggle("mp-arrow-up");var s=this.nextElementSibling;"block"===s.style.display?s.style.display="none":s.style.display="block"}));console.log("MP Settings Accordion Started!")}function mp_get_requirements(){wp.ajax.post("mp_get_requirements",{}).done((function(t){const e={ssl:document.getElementById("mp-req-ssl"),gd_ext:document.getElementById("mp-req-gd"),curl_ext:document.getElementById("mp-req-curl")};for(let s in e){let n=e[s];n.style="",t[s]||(n.classList.remove("mp-settings-icon-success"),n.classList.add("mp-settings-icon-warning"))}}))}window.addEventListener("load",(function(){mp_settings_accordion_start(),mp_get_requirements()}));